import styled from 'styled-components'

export const FooterContainer = styled.footer`
    background-color: #ededed;
    font-weight: 300;
    font-size: 14px;
    display: flex;
    justify-content: space-around;
    align-items: center;
`;

export const CenterBlock = styled.div`
    text-align: center;
`;
